export default function Sort(){

    return(
         <div className="flex w-[226px] h-[32px] ml-[12px] md:228px">

                <h6 className="w-[63px] h-[32px] rounded-[4px] border-1px border-[#B8B8B8] bg-[#FFFFFF] text-center pt-[4px] text-[16px] md:ml-[4px]">A to Z</h6>
                <h6 className="w-[87px] h-[32px] rounded-[4px] text-center bg-[#E3E3E3] ml-[10px] text-[16px] pt-[4px] md:ml-[4px]">Youngest</h6>
                <h6 className="w-[64px] h-[32px] rounded-[4px] pt-[2px] text-center ml-[10px] bg-[#E3E3E3] text-[16px] md:ml-[4px] ">Eldest</h6>

            </div>

    );
}
